import React from 'react';
import './App.css';
import Logo from './assets/logo.svg';
import Routes from './routes';

function App() {
  return (
    <div className="container">
      <img src={Logo} alt="Aircnc" />

      <div className="content">
        <Routes />
      </div>
    </div>
  );
}

export default App;
